import {Link} from 'react-router-dom';
import { useContext } from 'react';
const Home = () => {
    return (
        <div className = 'home'>
        <title>
          Gym Tracker Site
          </title>
          <br />
          <div>
            <button >
                <Link to="/ex" className='link'>Previous Workouts</Link>
            </button>
            
            <button>
                 <Link to="/create" className='link'>Add a Workout</Link>
            </button>
          </div>
        </div>
    );
}
 
export default Home;
